Stylish and lightweight app to remember and track your events in a simple and fast! 

View the remaining days or days elapsed after an event. You can use it to remind you: appointments, anniversaries, birthdays, holidays, exams, events festivals ... customize with your own photos or use the search feature that finds thousands of free images on Pixabay! You can also create an alarm for each individual event. You can choose a favorite event to be displayed every time you open the app! 

VIDEO: http://youtu.be/5hGuOXYthJs

Features: 
- Works on iPhone, iPad and iPod touch; 
- Choose the event image, from: camera, gallery or search online on Pixabay; 
- Creates a notification for each event; 
- You can choose a favorite event for display at startup; 
- Days remaining before an event; 
- Days elapsed after an event; 
- Double click on the countdown to change the color; 
- Drag the countdown wherever you want; 
- List of all events; 
- Unlimited number of events! 
- Share an event on social networks (Facebook, Twitter ...) or with your favorite applications, save, print, copy, use as background Wallpaper! 

For information or suggestions, please use the support form in the About menu of the application.
